import { createContext } from "react";


initialList = [
    { description: 'Code', date: '2021-7-2', time: '07:12'},
    { description: 'Eat', date: '2021-7-2', time: '09:12'},
    { description: 'Sleep', date: '2021-7-2', time: '01:12'}
];
export const TodoContext = createContext(initialList);
